/** @jsx jsx */
import React from 'react';
import { css, jsx, Global } from '@emotion/core';

import Layout from '../components/layout';

function Home() {
  const styles = css`
    margin: 0px;
    padding: 0px;
    background-image: url(https://images.wallpapersden.com/image/download/camille-league-of-legends_68170_1920x1133.jpg)
  `;

  const globalStyles = css`
    margin: 0px;
    padding: 0px;
  `;

  return (
    <div css={styles}>
      <Global css={globalStyles}/>
      <input type="text"></input>
      <button>Search</button>
      <stlyes jsx global>
        {
          `
          margin: 0px;
          padding: 0px;
        `
        }
      </stlyes>
    </div>
  );
}

export default Home;
